	a.ie_repasse,
	a.cd_cgc_administradora,
	substr((select	max(x.ds_razao_social)
	from	pessoa_juridica x
	where	x.cd_cgc = a.cd_cgc_administradora),1,40) ds_razao_social_adm,
	substr((select	max(x.nm_fantasia)
	from	pessoa_juridica x
